import 'package:final_api/api/category_api.dart';
import 'package:final_api/model/category.dart';
import 'package:final_api/model/dropdown_category.dart';

class FoodCategoryRepository {
  Future<bool> addFoodCategory(FoodCategory category) async {
    return await FoodCategoryAPI().addFoodCategory(category);
  }

  Future<List<DropdownFoodCategory?>> getAllDropdownFoodCategoryList() async {
    return await FoodCategoryAPI().getAllDropdownFoodCategoryList();
  }
}
